import React from "react";

export default function CardAddress({ account, balance }) {
    return (
        <div className="card">
            <div className="card-body">
                <h5 className="card-title">`Account: ${account}`</h5>
                <p className="card-text">`Balance: ${balance}`</p>
            </div>
        </div>
    );
}
